import React from "react";
import "./style/nav.css";

function nav() {
  return ( 
    <div className="nav">
      
      <div className="navContainer">
        <div className="links">
          <a href="#" className="links">Home</a>
          <a href="#" className="links">About</a>
          <a href="#" className="links">Service</a>
          <a href="#" className="links">Contact</a>
        </div>
      </div>
    </div>
  );
}

export default nav;
